INSERT INTO `chamados` VALUES (12,'William Santos','11 - GRU','','','william.santos@vipextransportes.com.br','Frota','O valor do custo do litro da bomba interna no código de estoque \"257\" estão fixados em 2,875 no FROTA. Favor verificar a fonte do problema e corrigir','','Finalizado','1',33,'2023-05-29 10:17:00',NULL,'../assets/files/Frota331685366234/','Baixa','<p>Perguntar ao William onde fica esta opção no FROTA</p>\r\n',NULL),(13,'Tania Kuhn','05 - BGV','VIPEXPOANT001','','gerencia.poa@vipextransportes.com.br','Conserto-de-Equipamentos','TÂNIA - POA\r\n\r\n\"minha mochila caiu e  bateu o notebook danificando a tela. enviei foto no Whats do TI para registrar o dano na Tela\"','','Em andamento','3',33,'2023-05-29 10:19:00',NULL,'../assets/files/Conserto-de-Equipamentos331685366374/','Media','<p>Aguardando Renata trazer o carregador</p>',NULL),(16,'Fernando Mello','11 - GRU','VIPEXGRUNT125','','fernando.mello@vipextransportes.com.br','SINTRA','<p>Sidnei, favor fazer comando para que, no ato da emiss&atilde;o de um CT-e em que a tarifa (percurso) n&atilde;o esteja negociada na tabela do cliente, o sistema considere a tarifa da tabela padr&atilde;o (VPX-PADRAO) para realizar o c&aacute;lculo do frete. Al&eacute;m disso, parametrizar o sistema para que essa op&ccedil;&atilde;o seja considerada automaticamente no cadastro de novas tabelas. Fico &agrave; disposi&ccedil;&atilde;o. Obrigado.</p>\r\n','','Finalizado','2',33,'2023-05-29 10:28:00','2023-05-31 08:23:00','../assets/files/SINTRA331685366928/',NULL,'<p>Sistema parametrizado e testado, funcionando Ok....!</p>\r\n',''),(17,'Fernando Mello','11 - GRU','VIPEXGRUNT125','','fernando.mello@vipextransportes.com.br','SINTRA','<p>Favor compartilhar API do ROUTEASY com a SIL para integrarmos ambos os sistemas.</p>\r\n','','Redirecionado','1',33,'2023-05-29 10:29:00',NULL,'../assets/files/SINTRA331685366966/','Alta','<p>Encaminhado para a SIL Sistemas #SIL-10098 aberto em 30/05/2023<br>Em 15/06 foi realizada uma reunião entre a equipe Routeasy x VIPEX x SIL para verificar sobre a integração.<br>Em 20/06 foi realizada uma reunião com a SIL Sistemas para ser alinhado alguns pontos.&nbsp;</p>',NULL),(18,'Fernando Mello','11 - GRU','VIPEXGRUNT125','','fernando.mello@vipextransportes.com.br','SINTRA','<p>Fernando Mello<br />\r\nSidnei, favor inserir colunas de % de comissionamento no rob&ocirc; de vendedores para verificarmos se os cadastramentos est&atilde;o sendo feitos da maneira correta.</p>\r\n','','Em analise','2',33,'2023-05-29 10:30:00',NULL,'../assets/files/SINTRA331685367006/',NULL,'<p>Percentual já inserido, somente validar !</p>',NULL),(19,'Igor Santos','11 - GRU','VIPEXGRUNT174','','igor.santos@vipextransportes.com.br','SINTRA','<p>Igor Santos<br />\r\nVIPEXGRUNT174<br />\r\nAltera&ccedil;&atilde;o de Vendedor em Massa<br />\r\nEnviado por email, rela&ccedil;&atilde;o de cnpj&#39;s que est&atilde;o no nome de colaboradores que j&aacute; n&atilde;o fazem mais parte do quadro, pe&ccedil;o para que alterem para o c&oacute;digo indicado ao lado de cada um deles, separei em 3 para facilitar</p>\r\n','','Em andamento','2',33,'2023-05-29 10:30:00',NULL,'../assets/files/SINTRA331685367043/',NULL,NULL,NULL),(20,'Valdomiro Fellippe','11 - GRU','VIPEXGRU205','','valdomiro.fellippe@vipextransportes.com.br','Planilha-Robo','<p>Valdomiro - VIPEXGRU205<br />\r\nSidnei, por gentileza criar uma planilha rob&ocirc; onde eu consiga visualizar todos os conhecimentos que possuem agendamento e n&atilde;o foram manifestados na data deste agendamento. Quero ter a vis&atilde;o apenas dessas pend&ecirc;ncias, para que eu possa tratar e cumprir o que foi agendado. Preciso de uma visualiza&ccedil;&atilde;o de todas as unidades.</p>\r\n','','Em andamento','2',33,'2023-05-29 10:31:00',NULL,'../assets/files/Planilha-Robo331685367097/',NULL,'<p>Em desenvolvimento !</p>',NULL),(21,'Gustavo Lima','11 - GRU','VIPEXGRU141','','gustavo.lima@vipextransportes.com.br','Ajuste-Planilha-Robo','<p>VIPEXGRU141 - Gustavo<br />\r\nSIDNEI CONFORME FALAMOS FAVOR, INCLUIR EM PASTA AUDITORIA O ROB&Ocirc; DE MANIFESTO COM DADOS DE CPF DO MOTORISTA .</p>\r\n','','Finalizado','2',33,'2023-05-29 10:33:00','2023-06-02 09:05:00','../assets/files/Ajuste-Planilha-Robo331685367212/',NULL,'<p>Planilha revisada, e disponibilizada na pasta V:\\AUDITORIA\\Robôs</p>','Relatório disponibilizado na pasta informada no chamado !'),(22,'Gustavo Lima','11 - GRU','VIPEXGRU141','','gustavo.lima@vipextransportes.com.br','SINTRA','<p>Gustavo - VIPEXGRU141<br />\r\nINCORPORA&Ccedil;&Atilde;O DO FROTA X SINTA N&Atilde;O EST&Aacute; TRAZENDO ADVs DA FILIAL 008-MRG PARA CONTAS APAGAR&gt;MANUTEN&Ccedil;&Atilde;O DE TITULOS... L&Eacute;O CIENTE!</p>\r\n','','Finalizado','1',33,'2023-05-29 10:34:00','2023-06-13 17:39:00','../assets/files/SINTRA331685367271/','Media','<p>Conversado com Gustavo em 31/05 e os problemas referente aos ADVs continuam. Necessário analisar mais a fundo e repassar a SIL Sitemas caso necessário.&nbsp;<br />\r\nProblema de integração entre FROTA x SINTRA</p>\r\n','Chamado concluído!'),(23,'Igor Santos','11 - GRU','VIPEXGRUNT174','','igor.santos@vipextransportes.com.br','Email','<p>Igor Santos - VIPEXGRUNT174<br />\r\nPara os colaboradores do corporativo (Meire, Gisleide, Igor, Thaila, Gabriel) criar no e-mail, uma regra para os e-mails onde cada um respectivamente esteja em c&oacute;pia, para que seja redirecionado automaticamente para uma pasta com o nome &quot;C&oacute;pias&quot;</p>\r\n','','Finalizado','1',33,'2023-05-29 10:34:00','2023-06-07 08:17:00','../assets/files/Email331685367297/','Baixa',NULL,'Criado a regra em todos os e-mails solicitados. '),(24,'Fernando Mello','11 - GRU','VIPEXGRUNT125','','fernando.mello@vipextransportes.com.br','Desenvolvimento-Projetos','<p>Fernando Mello - VIPEXGRUNT125 - SINTRA<br />\r\nENTREGA EM PARCEIROS/REDESPACHO Cen&aacute;rio atual: -&gt; Clientes insatisfeitos e status da entrega incorreto - CT-e &eacute; manifestado para entrega em parceiro para redespacho; - VIPEX baixa a entrega; - Cliente acessa o portal e o status consta como entregue; - Carga ainda est&aacute; no parceiro; - Cliente reclama no SAC, google e reclame aqui. Cen&aacute;rio proposto (1): - CT-e para entrega em parceiro ser manifestado como VIAGEM; Pontos de aten&ccedil;&atilde;o: - Processo de confer&ecirc;ncia da regi&atilde;o de destino ser manual; - Sistema n&atilde;o possuir trava que impe&ccedil;a um CT-e de redespacho de ser manifestado como ENTREGA; - Risco do desvio do processo persistir. Cen&aacute;rio proposto (2): 1. Regi&atilde;o de destino do CT-e = agente/parceiro? a. SIM = sistema trava o manifesto se o tipo for ENTREGA; b. SIM = sistema libera o manifesto se o tipo for VIAGEM; 2. Regi&atilde;o de destino do CT-e = agente/parceiro MAS a VIPEX que realizar&aacute; a entrega? a. SIM = usu&aacute;rio possui al&ccedil;ada para &ldquo;liberar/desbloquear&rdquo; pontualmente essa condi&ccedil;&atilde;o e manifestar para entrega.</p>\r\n','','Redirecionado','1',33,'2023-05-29 10:36:00',NULL,'../assets/files/Desenvolvimento-Projetos331685367392/','Alta','<p>A atualização do SINTRA Mobile para que tenha a funcionalidade de “Redespacho” no menu sai em 14/06 (quarta-feira).<br><br>Conversado hoje (06/06) com o Cristiano, para utilizar o parâmetro Cidade atendida, uma função para colocar como “Não - Agente”, assim ela entraria nos mesmos requisitos de uma cidade não atendida e que ela é atendida por um agente. Logo ao tentar incluir um CTe que a praça de destino é XX-AGT, ele emitirá o alerta: “Praça de Destino habilitada apenas para manifesto de viagem”</p>',NULL),(25,'Fernando Mello','11 - GRU','VIPEXGRUNT125','','fernando.mello@vipextransportes.com.br','Banco-de-Dados','<p>Fernando Mello - VIPEXGRUNT125<br />\r\nVELOCIDADE ROB&Ocirc; CT-ES COMPLETO Sidnei, conf conversamos, favor associar tabelas no banco de dados/servidor do rob&ocirc; de ct-es completo para aumentar a performance de busca dos dados. Obrigado!</p>\r\n','','Em andame