s sejam separados e distribuídos. Por gentileza, verificar com a equipe de desenvolvimento algo para suprir essa necessidade. &nbsp;Solicitar a visualização no manifesto via web e app mobile (Conferência eletrônica).&nbsp;</p><p>&nbsp; &nbsp;Identificamos também que no aplicativo de conferência eletrônica, não temos a visualização da quantidade de volumes do manifesto, apenas a quantidade de etiquetas emitidas. Por gentileza, solicitar alteração desse campo, para que a visualização seja da quantidade de volumes.</p><p>&nbsp;</p><p>Atenciosamente,</p><p>Douglas Baleeiro.</p><p>&nbsp;</p><p>&nbsp;</p>','','Redirecionado','1',74,'2023-06-02 15:53:00',NULL,'../assets/files/Desenvolvimento-Projetos741685731985/','Alta',NULL,NULL),(223,'Fernanda Pereira','11 - GRU','VIPEXGRU186','129','fernanda.pereira@vipextransportes.com.br','SINTRA','<p>Por favor, excluir ocorrência do ct-e 96560 &nbsp;<br>Remetente <a href=\"http://192.168.0.127/sintraweb/hftr900.aspx?3s64jne11oONo_-kvYslZt7y8xSsJbp3-iTZQuVFJ9Gi1wx2tleHj0wUW4U4t7Cs#\">Arte Cestas</a>.&nbsp;</p><p>&nbsp;</p><p><br>&nbsp;</p>','','Finalizado','3',96,'2023-06-02 15:58:00','2023-06-05 09:32:00','../assets/files/SINTRA961685732297/',NULL,'<p>Sem informação nenhuma&nbsp;</p>','Chamado concluído!'),(224,'Vinicius Oliveira','11 - GRU','VIPEXGRU221','1265','vinicius.oliveira@vipextransportes.com.br','SINTRA','<p>Boa tarde,<br>Solicito o cancelamento da Minuta 11-mi-7684, erro em emitira mesma.</p><p>Aguardo retorno.</p>','','Finalizado','17',94,'2023-06-02 16:18:00','2023-06-02 16:25:00','../assets/files/SINTRA941685733535/',NULL,NULL,'<p>minuta cancelada</p>'),(225,'William Santos','11 - GRU','VIPEXGRUNT247','1192','william.santos@vipextransportes.com.br','Octadesk','<p>Cancelar acesso gerado para atendimento de ordens de serviço no Frota.<br>Iremos utilizar outra plataforma.<br>Obrigado.</p>','','Finalizado','17',116,'2023-06-02 16:32:00','2023-06-02 16:48:00','../assets/files/Octadesk1161685734348/',NULL,NULL,'<p>Octadesk C