tendimento. As vezes estamos trabalhando no sistema, e os colaboradores requerem demanda especificas e precisamos encerrar as janelas que estamos trabalhando, para abrir outras janelas do sistema, e quando concluímos o atendimento, precisarmos retomar a nossas janelas antes encerradas, e isso causa retrabalho. Tendo um computador para o guichê, esse problema deixará de existir. Para esse computador, será preciso instalar o sistema FolhaMatic e acesso as pastas do RH e DP.<br><br>Se puderem nos ajudar integrando todos os nossos ramais do RH/SP para facilitar as conexões agradeço, os ramais à serem integrados são: 1155, 1158, 1169, 1170, 1226, 1235, 1236, 1237.<br><br>Agradeço antecipadamente,&nbsp;<br><br>Atte.,&nbsp;</p><p>Marcos Rovarotto</p>','','Finalizado','17',13,'2023-06-09 10:33:00','2023-06-12 15:20:00','../assets/files/Impressoras131686317595/',NULL,NULL,'Chamado concluído!'),(327,'Leonardo Santos','11 - GRU','VIPEXGRU000','1999999','leonardo.santos@vipextransportes.com.br','Outros','<p>teste</p>','','Finalizado','1',33,'2023-06-09 10:34:00','2023-06-09 13:56:00','../assets/files/Outros331686317668/','Baixa',NULL,'Chamado concluído!'),(328,'Comercial','','','','dvr@vipextransportes.com.br','Outros','<p>Trocar colaboradores de posição.</p><p>Irene na posição em frente a máquina que hoje esta a Tainara.</p><p>Cristiane na posição ao lado da que ela esta hoje, na parede onde ficava a antiga vendedora Claudineia.</p><p>a Talita na posição ao lado da Thayla</p><p>o Caio para a posição onde hoje esta a Tainara&nbsp;</p><p>Tainara na posição onde hoje esta a Talita.</p><p>Segue um anexo com um desenho, para ajudar.</p>','Equipe-posição.docx;','Finalizado','17',4,'2023-06-09 10:40:00','2023-06-09 13:27:00','../assets/files/Outros41686318019/',NULL,NULL,'troca concluída'),(329,'Antonio Rodrigues','09 - FLN','FLNSCNT002','9001','gerencia.fln@vipextransportes.com.br','Outros','<p>Todos os finais de semanas temos que colocar no grupo dos gestores saldo de transferência