xtra desses colaboradores. Precisamos de um filtro por data, por funcionário e que consiga gerar um arquivo CSV. Precisamos também de outra tela que seja visual para o usuário no ato do registro da biometria.&nbsp;</p><p>O aparelho biométrico encontra-se no departamento de TI, disponibilizado pelo Sr. Sidnei para testes e utilização. Estou a disposição para auxiliar no desenvolvimento.</p><p>&nbsp;</p><p>Atenciosamente,</p><p>Douglas Baleeiro</p>','','Em analise','1',74,'2023-06-09 17:13:00',NULL,'../assets/files/Desenvolvimento-Projetos741686341587/','Alta',NULL,NULL),(345,'Bruno Garcia','11 - GRU','VIPEXGRU229','1187','expedicao3.sao@vipextransportes.com.br','SINTRA','<p>Ao digitar um ct-e e selecionar a cotação, o sistema esta dando o erro de tarifa 0, mesmo com a cotação correta e constando o valor da negociação.</p>','','Finalizado','3',43,'2023-06-09 18:01:00','2023-06-12 07:37:00','../assets/files/SINTRA431686344478/',NULL,NULL,'Chamado concluído!'),(346,'Jessica Balestrin','04 - CTB','VIPCTB001','4005','adm1.ctb@viptransportes.com.br','Impressoras','<p>Instalar a nova impressora Jetlaser 2035 em todas as maquinas do escritório para começar a utilização.</p><p>Maquinas: VIPCTB001, VIPCTB002, VIPCTB004, VIPCTB005, VIPCTB006&nbsp;</p><p>Como irei pegar novamente minha impressora que está na maquina VIPCTB003 precisa instalar novamente a jetlaser 1020 na VIPCTB001 pois foi excluída.</p>','','Finalizado','3',108,'2023-06-12 07:56:00','2023-06-12 10:21:00','../assets/files/Impressoras1081686567418/',NULL,NULL,'Impressora instalada em todas as máquinas solicitadas'),(347,'Jessiel Vaz','11 - GRU','VIPEXGRU115','1164','faturamento2@vipextransportes.com.br','SINTRA','<p>Favor verificar o Cte 17- 82436, não estou conseguindo cancelar.</p>','17-_82436.jpg;','Finalizado','3',106,'2023-06-12 08:23:00','2023-06-12 08:27:00','../assets/files/SINTRA1061686568997/',NULL,NULL,'Ct-e cancelado'),(348,'Marcos Rovarotto','11 - GRU','VIIPEXGRUNT157','1158','marcos.rovarotto@vipextr