tre os colaboradores (música de fundo)</li><li>Uma gravação onde há o áudio de toda a conversa.&nbsp;</li></ul><p>Se conseguir ceder informações sobre o dia e hora que a ligação ocorreu para casos em que deseja verificar em algum relatório. Agradeço.&nbsp;<br><br>Realizar o encaminhamento dessas informações via Discord.</p><p>&nbsp;</p>','2023-06-05 13:10:00'),(43,83,0,1,'<p>Conforme solicitado, dia 31/05 foi aberto o chamado #SIL-10119 na SIL Sistemas para inclusão das informações nas consultas.&nbsp;<br><br>Status atualmente encontra-se “Em análise”. Vamos atualizando</p>','2023-06-05 13:15:00'),(44,230,0,17,'<p>veja se esta ok agora por favor</p><p>&nbsp;</p>','2023-06-05 13:34:00'),(45,245,0,1,'<p>Boa tarde,</p><p>Na SIL Sistemas foi aberto o chamado #SIL-10299 - “Limite emissão NF não está funcionando” na data de hoje 05/06/2023. Em breve, vamos atualizando o status conforme a progressão do chamado.&nbsp;</p>','2023-06-05 14:31:00'),(46,233,0,3,'<p>Ficou do Caio me avisar quando terminar de passar os arquivos</p><p>&nbsp;</p>','2023-06-05 14:34:00'),(47,155,74,0,'<p>Boa tarde!</p><p>01/05/2023 à 31/05/2023</p>','2023-06-05 14:48:00'),(48,222,74,0,'<p>Boa tarde!</p><p>Boa! Aguardo conclusão.&nbsp;</p>','2023-06-05 14:50:00'),(49,248,0,17,'<p>boa tarde Edimar, amanha o rapaz que conserta impressora vem ai e peço para ele dar uma olhada sem compromisso por favor guarde as folha como amostra</p><p>&nbsp;</p>','2023-06-05 15:18:00'),(50,155,0,2,'<p>Acabei de testar aqui, esta rodando normal…. faz um teste, qualque coisa me chama que acesso sua máquina…</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>','2023-06-05 16:09:00'),(51,256,0,17,'<p>VIVO PROTOCOLO 0606232131328 HORARIO 09:10 ATENDENTE ILANA, AGENDADO PARA QUARTA-FEIRA DIA 07/06/23 APARTIR DAS 08:00</p>','2023-06-06 09:08:00'),(52,259,0,3,'<p>Bom dia,&nbsp;</p><p>Em GRU - TI - Anúncios tem um tutorial de como criar uma conta na central de Suporte.</p>','2023-06-06 09:18:00'),(53,257,0,3,'<p>Bom dia,</p