:00'),(255,576,0,17,'<p>redirecionamento concluído de &nbsp;&nbsp;<a href=\"mailto:faturamento2@vipextransportes.com.br\">faturamento2@vipextransportes.com.br</a> &nbsp;para &nbsp;Monalizi &nbsp;<a href=\"mailto:monalizi.santos@vipextransportes.com.br\">monalizi.santos@vipextransportes.com.br</a>&nbsp;</p><p><br>&nbsp;</p>','2023-06-20 13:08:00'),(256,580,0,3,'<p>Boa tarde Katia, certeza que é esse conhecimento?</p>','2023-06-20 15:00:00'),(257,581,0,3,'<p>usuário: CFCRISTI09</p><p>Senha: Vipex1180*</p>','2023-06-20 15:07:00'),(258,587,0,1,'<p>Tenta emitir agora Edimar</p>','2023-06-20 16:24:00'),(259,605,0,3,'<p>Bom dia Nathalia, Só fechar todas as abas do navegador e abrir novamente</p>','2023-06-21 10:48:00'),(260,606,0,3,'<p>Bom dia, só fechar todas as abas do navegador e abrir de novo</p>','2023-06-21 10:52:00'),(261,607,0,1,'<p>Bom dia Kevin, tudo bem?<br><br>Seu chamado está faltando informações:&nbsp;<br>Qual o n° da minuta?<br>Qual era a região correta para sair?<br><br>Fico no aguardo!</p>','2023-06-21 11:00:00'),(262,602,0,1,'<p>#SIL-10856 é o chamado aberto na SIL Sistemas, eles irão monitorar nosso servidor durante o dia para averiguar qual o problema.&nbsp;</p>','2023-06-21 11:03:00'),(263,600,0,1,'<p>Bom dia Daniel, tudo bem?<br><br>#SIL-10856, chamado aberto na SIL Sistemas, ficarão acompanhando nosso servidor durante o dia para averiguar o problema, caso sinta instabilidades, utilize nosso servidor secundário <a href=\"https://sintraweb2.sdso.com.br:444/sintraweb/login.aspx\">clicando aqui</a>.</p>','2023-06-21 11:05:00'),(264,65,0,1,'<p>Bom dia Igor, tudo bem?<br><br>Andamento sobre o chamado.&nbsp;<br>Após algumas conversas com a SIL, solicitamos para desenvolvimento a funcionalidade para atrelar o valor de TRT junto a outra tarifa (no caso, especificado o despacho).&nbsp;</p>','2023-06-21 11:07:00'),(265,17,0,1,'<p>Bom dia Fernando, tudo bem?<br><br>Algumas atualizações referente a este chamado.&nbsp;<br><br>Chamado aberto na SIL Sistemas #SIL-10098<br>Em 15/06 foi realizada uma reunião entre Routeasy x VIPEX x SIL para verificar sobre a integração. Foi discutido sobre a API e as informações que cada plataforma (SINTRA x Routeasy) deveria receber e devolver. Também foi discutido o que é esperado em primeiro momento da Routeasy (roteirização de um caminhão a partir do romaneio) e depois ir evoluindo conforme as necessidades.<br><br>Em 20/06 foi realizada uma reunião com a SIL Sistemas para ser alinhado alguns pontos, mas principalmente análise de expectativa e valores. A SIL afirma que entrou em contato particular com a equipe da Routeasy e com a intenção também de melhorar o sistema, eles juntos desenvolverem uma API de integração ponta-a-ponta, onde todo o tratamento dos dados seria realizado dentro do SINTRA, sem a necessidade de verificar as informações na Routeasy.&nbsp;<br>A SIL nos ofereceu uma conta para fazermos alguns testes na plataforma para alinhamento de expectativa. Em breve, disseram que entrarão em contato para repassar a conta de testes</p>','2023-06-21 11:15:00'),(266,124,0,1,'<p>Bom dia,&nbsp;</p><p>O chamado #3780 está sendo tratado pela NATIVE pelo agente Allan Miranda. Encaminhei os n° de protocolos repassado via Discord para ele e questionei se a informação do protocolo apenas era suficiente para ele encontrar o arquivo. Vou atualizando sobre.&nbsp;</p>','2023-06-21 11:16:00'),(267,610,0,3,'<p>Bom dia,</p><p>A lista de ramais é atualizada conforme o responsável de cada Filial/Setor passar para a gente, se não está atualizada, o responsável não informou.</p>','2023-06-21 11:28:00'),(268,586,96,0,'<p>Está okay</p>','2023-06-21 14:35:00'),(269,535,134,0,'<p>Boa Tarde!!</p><p>Ela chegou está conectada &nbsp;na maquina VIPEXBHZ004 &nbsp;consegue estalar ela por favor.</p><p>E Compartilhar ela com a maquina 002 E 003.</p><p>Por favor. &nbsp;</p>','2023-06-21 15:09:00'),(270,621,0,17,'<p>aguardando solicitante</p>','2023-06-21 16:26:00'),(271,628,0,17,'<p>em analize</p>','2023-06-22 08:10:00'),(272,630,0,3,'<p>Bom dia Thaila, qual era o número desse WhatsApp?</p>','2023-06-22 08:10:00'),(273,624,0,1,'<p>Bom dia Cris, tudo bem?<br><br>No caso, foram problemas de emissão nos dois CTe\'s 25-20986/21833.&nbsp;<br>As coletas que estão atreladas aos CTe\'s são do tipo: “Recebimento”.&nbsp;</p><p>Logo, o que acontece quando temos coletas deste tipo?<br>Com coletas de recebimento, ele considera o emissor do CTe como a origem da cidade.&nbsp;</p><p>O CTe foi emitido pelo 25, estabelecimento 25, a cidade origem dele é de Porto Alegre.&nbsp;<br>Para a emissão ter sido feita corretamente, haveria de ser feita pelo estabelecimento 5.&nbsp;</p><p>Nestes dois casos, foi erro de emissão.&nbsp;</p>','2023-06-22 08:19:00'),(274,624,52,0,'<p>Bom dia!<br><br>Obrigada pelo retorno.</p><p>Vou passar a informação para o Shelon e vou solicitar o desconto nos fretes.</p><p>Pode fechar o chamado.</p>','2023-06-22 08:44:00'),(275,632,0,1,'<p>Foi reportado para a SIL Sistemas, eles realizaram um ajuste e pediram para ficarmos monitorando, deixarei o chamado em aberto até normalizar</p>','2023-06-22 08:58:00'),(276,631,0,1,'<p>Conversado com a SIL Sistemas, eles ajustaram e pediram para ficarmos monitorando, deixarei o chamado aberto até a finalização.&nbsp;</p>','2023-06-22 08:58:00'),(277,635,0,1,'<p>NATIVE #4141 aberto para a empresa relatando a instabilidade, o motivo está no uso de CPU que está alcançando os 94% / 96% causando a lentidão relatada. Aguardando retorno.&nbsp;</p>','2023-06-22 09:00:00'),(278,607,0,1,'<p>Bom dia, tudo bem?</p><p>Aviso que o chamado será encerrado no dia 28/06 por caso de inatividade se ficarmos sem respostas até lá.&nbsp;</p>','2023-06-22 09:03:00'),(279,638,0,1,'<p>Bom dia Josilene, tudo bem?</p><p>Você estava fazendo pelo estabelecimento 306 ou 6?</p>','2023-06-22 09:37:00'),(280,638,87,0,'<p>pelo 306</p>','2023-06-22 09:40:00'),(281,638,0,1,'<p>Encontrei aqui no 306, realizei a exclusão.&nbsp;</p>','2023-06-22 09:40:00'),(282,638,87,0,'<p>obri