INSERT INTO `chamados_sil` VALUES (1,2399,0,1,'Karina Fujisawa','SINTRA','Relatado sobre a situação onde é solicitado uma coleta que já passou da nossa janela de coleta, por exemplo, a região é feita coleta só até as 14h da tarde e caso necessite só sera feita para o dia seguinte. Mas inserir no SINTRA uma opção que o agente pode marcar que a mercadoria já está disponível (embalada e etc) e o motorista só precisa passar para coletar, então, caso o motorista consiga ele veja que a mercadoria já está disponível e coleta mesmo que tenha passado do prazo. Essas infos ficarão disponíveis para visualização no Gerenciamento de Coletas; ','Orçamento em Aprovação','Melhoria','2023-06-02 14:31:00',NULL,'<p>Teste</p>','2023-06-02 15:11:00','Disponibilidade de Mercadoria na Coleta'),(2,10098,0,1,'Valdeci Rodrigues e Fabian Noro','SINTRA','<p>Gostaria de solicitar para a SIL verificar a possibilidade de integrar a API da RoutEasy com o SINTRA</p><p>Segue link da documentação<br>https://routeasy.readme.io/reference/tipos-de-integra%C3%A7%C3%A3o</p>','Reunião agendada','Melhoria','2023-06-05 16:41:00',NULL,'<p>Reunião 15/06 às 14h realizada com a equipe da SIL Sistemas x Routeasy<br>Foram ajustados alguns pontos referente a integração, dados que precisam ser enviados e recebidos pelo TMS.</p>','2023-06-15 15:55:00','Integrar roteirizador Routeasy com SINTRA'),(3,10113,0,1,'Valdeci Rodrigues','SINTRA','<p>Recebemos este comunicado da Averbe Porto, estamos apenas repassando caso seja necessário realizar algumas adaptações técnicas</p>','Finalizado','Melhoria','2023-06-05 16:42:00',NULL,'<p>@Cliente Boa tarde.....Estaremos verificando, porém, não tínhamos recebido em nenhum momento anterior nada sobre alterações, e já me adianto que se tiver alterações substanciais na integração, ficara muito complicado para que esteja disponível para a data de 05/06. Estarei passando para frente o assunto para um analista verificar a integração atual x esta nova e verificar o impacto.</p>','2023-06-05 16:44:00','Protocolos de Seguranca - VIPEX Transportes LTDA'),(4,10118,0,1,'Cristiano Jacobsen','SINTRA','<p>Hoje o cenario atual, envolve algumas situacoes com Cartas de Correcao que chega a ser estranho a quantidade.<br>Provavelmente, a carta de correcao nao influencia em nada, mas quando os casos vem pra gente, sempre o usuario fala: \"Teve carta de correcao\".<br><br>O usuario BRUNO 11, recebeu uma carta de correcao para alterar a nota 11202 na coleta 11-395964 de 2 volumes para 01 volume apenas.<br>Apos realizar a alteracao e efetuar a emissao das novas etiquetas (utilizando a opcao individual, nao a \'em lote\' como instruido pelo Cristiano Jacobsen) ela gerou duas etiquetas.<br>Uma 001/001 e outra 002/001.<br><br>Gostaria de entender o motivo destas quantidades antigas misturadas com as novas. Isso ja aconteceu em outros casos, onde por exemplo.<br>Nota 1234, 12 volumes, houve uma correcao para 13 volumes, ele altera e imprime na opcao individual.<br>Entao, saem 12 etiquetas (quantidade antiga) com a numeracao nova (001/013) e por ai vai.<br><br>Gostaria de entender o que causa este problema, mas os casos quando vem para nos, sempre sao casos de cartas de correcao.<br>&nbsp;</p>','Aguardando cliente','Alta','2023-06-05 16:46:00',NULL,'<p>@Cliente bom dia,<br>verificando a situação passada e consultando a coleta e nota indicada ainda esta com os dois volumes, não teve alteração, por isto a quantidade de etiquetas continua para dois volumes, mas compreendi como foi a emissão, foi simulei conforme foi instruído e ajustou as informações.<br>image.png<br>&nbsp;</p>','2023-06-05 16:46:00','Etiquetas após Carta de Correção'),(5,10119,0,1,'Cristiano Jacobsen','SINTRA','<p>Hoje, nossa equipe de vendas, dentre uma das formas de abordagens para conquistar clientes, elas utilizam a consulta de orcamentos.<br>Então, normalmente, elas utilizam para consultar por exemplo, por que um cliente não fechou um frete, foi valor? o que foi? qual a necessidade do cliente?<br>A primeira consulta feita e qual a origem (cidade) e quem e o pagador do frete (CIF ou FOB). Entao, elas entram orcamento por orcamento para checarem isso.<br><br>A solicitacao e que seja possivel duas colunas com estas informacoes na tela de consulta de orcamentos (HFTR009c), uma com a Origem e outra com o Pagador do Frete.<br>Se for possivel incluir esta informacao no arquivo em PDF também, agradeco.</p>','Em análise','Melhoria','2023-06-05 16:55:00',NULL,'<p>Leo, só para alinhamento da solicitação, incluir na HFTR009c uma coluna \'Origem\' e \'Tipo de Frete\', certo.</p>','2023-06-05 16:55:00','Melhorias na Consulta de Orçamentos'),(6,10172,0,1,'','SINTRA-Mobile','<p>Estamos com um caso que e feito um Manifesto para o motorista CPF 31824927053, PLACA MDL-3811, que e adicionado as entregas e coletas no manifesto, porem no aplicativo nao sobe nenhum.<br>Estou com o caso do Manifesto 309-653 que foi feito ontem e um que foi feito hoje 309-660. O certo seria aparecer o de hoje 660, porem so aparece conforme o print.</p>','Em desenvolvimento','Media','2023-06-05 16:56:00',NULL,NULL,NULL,'Entregas e coletas não aparece no usuário do motorista'),(7,10193,0,1,'Karina Fujisawa','SINTRA','<p>Ao utilizar a tela Frota.BaixarVeiculo ele retorna um erro de sistema dizendo que \"URI invalido: o nome do host nao pode ser analisado\"</p>','Finalizado','Baixa','2023-06-05 16:58:00',NULL,'<p>Questionado a equipe da SIL Sistemas referente aos chamados que entram no status “Gerando versão” se, eles estão gerando a versão para disponibilizar ou o status significa que a versão já foi gerada e basta atualizar.&nbsp;</p><p>Questionado se o ajuste já contempla na versão 04.42.784 ou virá na 04.42.785.</p>','2023-06-07 11:04:00','Baixa de Veiculo retorna erro em sistema'),(8,10262,0,1,'','SINTRA','<p>Estamos para realizar a criacao de um box especificamente para produtos que o tipo de cobranca esta como \"Antecipado\", a ideia corre no mesmo sentido da solicitacao da melhoria no Monitoramento de Entregas.<br>Precisamos no ato da descarga, identificar o que esta como \"Antecipado\" e \"Nao pago\" para destinarmos a esta praca.<br>Cenario esperado<br>No documento \"rftr540v.aspx\", emissao do manifesto no tipo \"Embarque/Desembarque\", precisamos de uma coluna que faca esses indicativos. O ideal seria uma coluna escrito \"Cobranca\".<br>Nela, os \"Antecipados\" e \"Nao pago\" ia ficar como \"AN\" e os \"Antecipados\" e \"Pagos\" ia ficar como \"AP\"</p>','Em análise','Melhoria','2023-06-05 17:00:00',NULL,NULL,NULL,'Box de Antecipados (SINTRA)'),(9,10274,0,1,'','Conferencia-Eletronica','<p>Cenario atual<br>Estamos para realizar a criacao de um box especificamente para produtos que o tipo de cobranca esta como \"Antecipado\", a ideia corre no mesmo sentido da solicitacao da melhoria no Monitoramento de Entregas. Precisamos identificar quais os conhecimentos que estao com a cobranca como \"Antecipado\" e \"Nao pago\" para direcionar ao box determinado.<br>Cenario esperado<br>Precisamos que no aplicativo do Conferencia Eletronica, esta informacao fique visivel durante o desembarque. Para que o conferente ja tenha a nocao que precisa direcionar este conhecimento para esta praca.<br>O que pensamos aqui na melhor alternativa seria algo nesse sentido.<br><br>1 - Agente vai realizar a leitura da etiqueta<br>2 - Aquela nota fiscal pertence a um CTe que e \"Antecipado\" e \"Nao pago\"<br>3 - Ao realizar a leitura, o app emite um pop-up \"Nota Fiscal com CTe Antecipado e Nao pago, favor, armazene em uma praca antes de realizar a descarga\". (Aqui normalmente a equipe faz a armazenagem primeiro para depois bipar a descarga).<br>4 - O conferente direciona o CTe para a praca que deseja.<br>Nestas situacoes, se nao houver uma armazenagem no estabelecimento que ele esta tentando descarregar (Exemplo: seguindo essa teoria, se armazenarem no estab 6 [origem], quando chegar aqui no estab 11 [destino] para descarregar, ele deixaria fazendo apenas a leitura, mas no caso, a armazenagem precisa ser do estab que esta fazendo a descarga no momento).<br>Outro parametro e que, enquanto uma armazenagem nao for feita, este aviso continuara exibindo na tela do agente toda vez que ele tentar efetivar a leitura da etiqueta.</p>','Aguardando cliente','Melhoria','2023-06-05 17:01:00',NULL,NULL,NULL,'Box de Antecipados (Conferencia Eletronica)'),(10,10195,0,1,'','SINTRA','<p>Boa tarde,<br>Gostaria de saber se na parte de ICMS Antecipados eu consigo bloquear o usuario que tem acesso a varios estabelecimentos, se podemos fazer algum tipo de bloqueio que o usuario só possa gerar guias de tal estabelecimento.</p><p>Cenário esperado:<br>Um tipo de bloqueio para que o usuario possa emitir a Guia de um so estabelecimento, mantendo o acesso aos outros estabelecimentos.</p>','Em consultoria','Media','2023-06-05 17:53:00',NULL,NULL,NULL,'ICMS Antecipado'),(11,2145,84835,1,'Cristiano Jacobsen','SINTRA','<p>Acredito que ja havia comentado isto anteriormente com voces. Na tela de Devolucao / Reentrega (TCAD024d) onde nossas Devolucoes e Reentregas sao cobradas 50% do valor (poucos casos que a porcentagem e menor ou maior). e quando colocamos uma % Total ali, ele nunca e cobrado os 50% exato do documento anterior, em alguns casos, o 50% e cobrado corretamente, mas em outros, precisamos ficar alterando o valor para 56%. Acredito que deva ser algo relacionado a alguma taxa que hora ou outra e cobrada que nao entra nessa %.<br><br>Se puderem nos ajudar quanto a isso, agradeco</p>','Orçamento em Aprovação','Melhoria','2023-06-05 17:55:00',NULL,'<p>Orçamento encaminhado no valor de R$ 2470,00</p><p>&nbsp;</p>','2023-06-05 17:56:00','Devolução / Reentrega'),(12,2393,0,1,'Valdeci Rodrigues / Karina Fujisawa','SINTRA','<p>Encaminhado o projeto: <a href=\"https://www.figma.com/file/sBvYKWBOfqYAXR5p1ANR7I/Confer%C3%AAncia-Eletr%C3%B4nica?node-id=46%3A63&amp;t=CPkB670mDCfxkt4C-1\">https://www.figma.com/file/sBvYKWBOfqYAXR5p1ANR7I/Confer%C3%AAncia-Eletr%C3%B4nica?node-id=46%3A63&amp;t=CPkB670mDCfxkt4C-1</a><br><br>O projeto consiste na possibilidade de realizar um agendamento automatizado via WhatsApp e E-mail. O cliente utiliza o link, confirma as informações, escolhe uma data para entrega e a ocorrência de agendamento é realizada. O projeto será utilizado mais para Pessoas Físicas mas algumas jurídicas podem ser adicionadas ao montante.&nbsp;</p>','Fase de Testes','Melhoria','2023-06-07 09:03:00',NULL,'<p>No dia 06/06 foram realizados os testes com a atualização disponibilizada na versão 04.42.784. Nela contemplava os ajustes solicitados durante uma reunião após o lançamento da funcionalidade em sua versão beta na 04.42.473.&nbsp;<br><br>Alguns ajustes que solicitamos referente a puxar as informações de telefone e e-mail foram realizadas, mas alguns ajustes envolvendo variáveis que não estão funcionando em alguns textos, ajustes de grid e outros.&nbsp;<br><br>As solicitações de ajustes podem ser consultadas no link do drive: <a href=\"https://drive.google.com/drive/folders/1N4ST4AHPvP9tJLKj2WJ-8rOgEav0TPoH\">SIL - Google Drive</a>, na pasta do Agendamento Automatizado referente a versão 04.42.784 em PDF<br><br>Foi conversado hoje que os chamados abertos posteriormente sobre o Agendamento será fechado e os novos chamados serão tratados neste card #2393, o PDF com as atualizações da versão 784 foram adicionados mais alguns ajustes que constam na versão 04.42.786<br><br>14/06 → Problemas reportados pelos clientes onde ao marcar a opção de confirmar endereço como “Sim” ou “Não”, ele esta retornando um erro que foi incluído no drive da SIL<br>19/06 → Resolvido problema relatado em 14/06</p>','2023-06-19 08:54:00','Agendamento de Entrega Automatizado'),(13,2197,0,1,'','SINTRA','<p>Para termos o custo de distribuicao apurado, precisamos mensurar a qtd utilizada de ajudantes por manifesto.<br><br>Logo, favor solicitar para a SIL desenvolvimento que viabilize:<br><br>• Identificacao da equipe de entrega em todos os manifestos;<br>• Os campos AJUDANTE 1 e AJUDANTE 2 devem ser de preenchimento obrigatorio para encerramento do manifesto;<br>• No ato da emissao, talvez nao se tenha as informacoes do AJUDANTE 1 e 2;<br><br>Cadastros de funcionarios:<br><br>• Substituir o campo CODIGO pelo campo CPF para cadastro de um novo funcionario;<br>• Deve constar na relacao COLABORADORES ATIVOS e CHAPAS, que serao diferenciados no campo TIPO:<br>&nbsp;CLT:<br>&nbsp;CONFERENTE<br>&nbsp;ARRUMADOR<br>&nbsp;AJUDANTE<br>&nbsp;CHAPA:<br>&nbsp;CHAPA</p>','Fase de Testes','Melhoria','2023-06-07 11:07:00',NULL,NULL,NULL,'Equipe de Entrega Manifesto'),(15,2307,84846,1,'Karina Fujisawa','SINTRA','<p>Uma das solicitacoes vindas do comercial para melhoria do orcamento era a possibilidade de alterar a \'Origem\'.<br><br>Quando o usuario fizesse pelo formulario que implementamos no site por exemplo, que entra na parte de Aplicativos &gt; Orcamentos de Frete &gt; Orcamentos recebidos ao gerar o formulario ele saia como a origem \"Orcamento Web\".<br><br>Quando o orcamento fosse feito por Conhecimentos &gt; Orcamentos &gt; Manutencao, o campo origem fosse possivel escolher entre WhatsApp / E-mail / Telefone Fixo / Chatbot, para assim termos uma filtragem melhor de por onde esta entrando o maior fluxo dos orcamentos e para facilitar os rastreamentos caso necessitamos consultar o que foi acordado com o cliente na hora.</p>','Aguardando SIL','Melhoria','2023-06-07 11:19:00',NULL,'<p>E-mail encaminhado em 26/04 para aprovação.&nbsp;<br>Análise da Situação Proposta: OK<br>Valor a ser cobrado: R$ 3.420,00<br>Prazo: 20 dias úteis após aprovação do orçamento.&nbsp;</p>','2023-06-07 11:27:00','Inserir Origem do Orçamento'),(17,4097,85143,1,'Raquel Foscarini','SINTRA','<p>Boa tarde,<br><br>Solicitacao de melhoria, gostariamos que a alteracao de vencimento de fatura fosse possivel ser feita a partir do CTe.<br><br>Hoje, quando e necessario fazer alteracao da fatura, a equipe vai em: Financeiro &gt; Contas a receber &gt; Manutencao de Titulos &gt; Menu em Hamburguer da fatura &gt; Alterar vencimento. (vide anexo 0002.png)<br>Eles solicitam que fosse possivel, consultar o CTe, clicar no numero da fatura, acoes &gt; Alterar vencimento. (vide anexo 0001.png)</p>','Finalizado','Melhoria','2023-06-07 14:45:00',NULL,'<p>Orçamento encaminhado em 29/03<br>Situação Proposta: OK<br>Valor: R$ 760,00<br>Prazo: 5 dias úteis após a aprovação do orçamento</p>','2023-06-07 14:48:00','Alteração de Vencimento de Fatura pelo CTe'),(18,4107,0,1,'','SINTRA','<p>Bom dia,<br><br>O Sidnei comentou comigo que ja temos este problema ha um bom tempo e vi acontecendo, mas infelizmente nao consegui os prints.<br>Durante a emissao de CTe\'s Substitutos existem situacoes em especifico que ele \"some\" com as informacoes que o identifica como um substituto.<br><br>No banco de dados, na tabela sintra.CNHCAD temos algumas colunas como: Cnh_cansub, Cnh_origem, Cnh_canser, Cnh_cannum, Cnh_cannts, Cnh_canntd, Cnh_canntm, Cnh_canntc, Cnh_canntv que dizem respeito as indicacoes de substituto.<br>Quando um colaborador esta fazendo um CTe substituto onde precisa alterar apenas o valor correspondente, o procedimento passa normalmente e o CTe e emitido com o indicativo (ocorrencia) de que trata-se de um substituto.<br><br>Quando o colaborador faz o CTe substituto e altera orcamento / tomador ou quaisquer outras alteracoes fora o valor, ao confirmar a segunda tela (depois da que confirma o cancelamento), essas informacoes nas colunas \"Cnh_can\" somem e e preciso fazer a insercao completamente via banco.<br><br>Segue um e-mail encaminhado do nosso colaborador que faz a emissao dos substitutos</p>','Finalizado','','2023-06-07 14:49:00',NULL,NULL,NULL,'CTe\'s substitutos'),(19,6267,85374,1,'Valdeci Rodrigues','SINTRA','<p>Prezados,<br><br>Estamos precisando incluir em Conhecimentos por Data (tela HFTR915), incluir uma coluna de UF do destinatario. Isto se faz necessario para analise financeira por estado.</p>','Orçamento em Aprovação','Melhoria','2023-06-07 14:55:00',NULL,'<p>Orçamento encaminhado em 26/04<br>Situação proposta: OK<br>Valor: R$ 1330,00<br>Prazo: 20 dias úteis após a aprovação do orçamento</p>','2023-06-07 14:56:00','Inserir nova coluna em Conhecimentos por Data'),(20,10344,0,1,'Cristiano Jacobsen','SINTRA','<p>Alguns casos de substituto quando estamos realizando, ele esta acontecendo um bug onde, ao tentar informar que o tomador (responsavel) e um terceiro e clicar em confirmar, ele troca o tomador pelo remetente ou destinatario e retorna o erro que \"Responsavel deve ser diferente do remetente e destinatario\" que e o alerta quando marcamos que o responsavel e terceiro mas informamos o remetente ou destinatario no campo.<br><br>Nao sao todos os substitutos que isso acontece, mas a frequencia tambem e grande. A forma que encontramos para contornar isto e pegar o numero de controle, e fazer a alteracao nos campos Cnh_clifat e Cnh_resfre na tabela de SINTRA.CNHCAD para o correto e entao ele passa.<br>Cenario esperado<br>Entender a causa do problema e corrigir para que os substitutos nao necessitem da ajuda do T.I via banco de dados para fazer as alteracoes<br><br>Estou anexando dois prints e estou encaminhando para Valdeci Tres, Cristiano Jacobsen e Karina Fujisawa o video que foi gravado realizando o processo</p>','Finalizado','Critica','2023-06-12 08:41:00',NULL,'<p>Atualizar a versão e realizar os testes</p>','2023-06-12 08:42:00','Substituto altera o CNPJ do tomador'),(21,10321,0,1,'','SINTRA','<p>Nosso diretor Fernando Mello pediu para questionarmos uma questao sobre o conferencia eletronica<br>Cenario esperado<br>A possibilidade de incluir no app uma funcao onde podemos anexar imagens. Estas imagens seriam do caminhao carregado. (cerca de 3 fotos aproximadamente) essas fotos seriam lancadas automaticamente no manifesto utilizado para visualizar o processo de carregamento e descarregamento.<br><br>Como a ideia e subir imagens de 30%/60%/100% do caminhao carregado/descarregado, haveria de ter um botao de atalho para subir estas imagens (como possui o do box). Ele armazenaria as imagens e lancaria automaticamente a imagem da carga no manifesto.</p>','Em análise','Duvida','2023-06-12 09:08:00',NULL,NULL,NULL,'Lançamento de Fotos no Conferência Eletrônica'),(22,10303,0,1,'','SINTRA','<p>Tivemos um manifesto de viagem 11-28527 de GUARULHOS x SUMARE. No entanto, um dos colaboradores lancou uma ocorrencia de chegada a partir do estabelecimento de origem do manifesto (estab 11)<br>Cenario esperado<br>Realizar uma trava para que no momento da baixa do manifesto (ocorrência de chegada, inicio e fim) so permitir ser lancada pelo estabelecimento de destino do manifesto.</p>','Em análise','Melhoria','2023-06-12 09:12:00',NULL,NULL,NULL,'Ocorrência de chegada, inicio e fim de descarga'),(23,10287,0,1,'','SINTRA','<p>Hoje, temos algumas ocorrencias que o proprio usuario (caso tenha liberado), ele consegue realizar algumas opcoes caso a ocorrencia ja tenha sido lancada.<br><br>Manter<br>Reinformar<br>Excluir<br>Cenario esperado<br>No historico 012/001, o colaborador informou que as imagens que sao anexadas via SilTrack, ele consegue excluir. Mas quando ja foi lancada por um usuario comum, ele diz nao conseguir realizar a exclusao. O usuario e o RUBENS 01.<br>O historico razao 012/001 e correspodente a imagem do comprovante de entrega</p>','Aguardando SIL','Media','2023-06-12 09:15:00',NULL,NULL,NULL,'Exclusao de Comprovante de Entrega'),(24,10240,0,1,'','SINTRA','<p>Desenvolver integracao com Twilio para mensageria via Whatsapp.<br><br>Encaminhado sites e links com as documentações da twilio</p>','Em triagem','Alta','2023-06-12 10:48:00',NULL,NULL,NULL,'Integração WhatsApp - Twilio'),(25,9731,0,1,'Karina Fujisawa','SINTRA-Mobile','<p>Conseguimos parametrizar dentro do SilTrack se e obrigatorio que:<br><br><br>Cenario esperado<br>- Insira ao menos 1 foto do comprovante<br>- Insira ao menos 3 fotos de carga<br><br>Considerando tanto coleta e entrega</p>','Aguardando SIL','Duvida','2023-06-12 11:06:00',NULL,'<p>Karina estará dando andamento na solicitação</p>','2023-06-12 11:07:00','Requisito de Fotos de Carga e Comprovante'),(26,9647,0,1,'','SINTRA','<p>Ao entrar na tela de Planejamento de Entregas &gt; Agendamentos, a tela fica apenas em loading na versao 04.42.782<br>Na versao 04.42.770, este problema nao acontece<br>Cenario esperado<br>versao 04.42.782 abrir a tela de Agendamentos sem problemas como a versao 04.42.770</p>','Finalizado','Melhoria','2023-06-12 11:10:00',NULL,NULL,NULL,'Planejamento de Entregas fica apenas carregando'),(27,9661,0,1,'','SINTRA-Mobile','<p>Solicitado que o aplicativo Siltrack seja atualizado com a aba de redespacho<br><br>*Antes de realizar atualizacao do aplicativo, sera necessario criar os seguintes itens abaixo<br><br>*Criar um novo parametro na tela TCAD111 aba manifestos, campo \'Exige tipo de viagem\' com o valor ( Normal e transferencia)<br><br>*Na tela ParametrosGeraisApps, alterar a nomenclatura do campo \' carregamento\' para \' lotacao\'<br><br>* No app passar a exibir o estabelecimento destino e testar o tipo do estabelecimento informado na TSIL001<br>Campo emp_tip = E ( Nao exibir os manifestos na aba de redespacho)<br>Campo emp_tip = A (Exibir os manifestos na aba de redespacho, mas nao exibir os conhecimentos desse manifesto na aba de entrega)</p>','Em triagem','Melhoria','2023-06-12 11:32:00',NULL,NULL,NULL,'APP Siltrack e inclusao parametro'),(28,10490,0,1,'','SINTRA','<p>No site da VIPEX Transportes na funcionalidade de Rastreador: http://vipextransportes.com.br/site/default.asp?TroncoID=738182&amp;SecaoID=725274&amp;SubsecaoID=0<br><br>Ao tentar realizar a consulta de uma nota, ele esta retornando uma tela de \'Erro de Servidor no Aplicativo \'/PortalWeb\'.<br>Verificar o que esta causando o erro</p>','Finalizado','','2023-06-13 09:20:00',NULL,NULL,NULL,'Rastreador do site VIPEX'),(29,10494,0,1,'Cristiano Jacobsen','SINTRA','<p>Possuimos a opcao na tela TCAD112b (Origens/destinos nao permitidos), infelizmente acredito que ou para alguns estabelecimentos ou alguns estados nao esta parametrizado corretamente a funcao.<br>Recebemos um e-mail estes dias do nosso Gerente Nacional Operacional onde o mesmo nos repassou varios CTe\'s que foram emitidos erroneamente (que o Origens/destinos haveria barrado) e esta cadastrado no sistema a origem/destino que permitiu a emissao.</p><p><br>Verificar o ocorrido, em breve, estarei encaminhando prints do e-mail no drive com a pasta de mesmo nome do card.<br><a href=\"https://drive.google.com/drive/folders/1N4ST4AHPvP9tJLKj2WJ-8rOgEav0TPoH?usp=sharing\">https://drive.google.com/drive/folders/1N4ST4AHPvP9tJLKj2WJ-8rOgEav0TPoH?usp=sharing</a></p>','Em análise','Critica','2023-06-13 09:22:00',NULL,'<p>13/06 → Encaminhado exemplos para o Cristiano</p>','2023-06-13 17:48:00','Origens/destinos não permitidos'),(30,8959,0,1,'Valdeci Rodrigues','SINTRA','<p>Boa tarde,<br><br>Segue as solicitacoes para a SIL Sistemas conforme conversado na reuniao de ontem 24/04 e 25/04 sobre tabelas de frete.<br>Fico apenas devendo o envio do novo modelo de emissao em PDF e CSV da tabela de frete.</p><p>No dia 09/05 foi encaminhado o layout da tabela de frete</p><p>&nbsp;</p>','Em consultoria','Melhoria','2023-06-13 09:25:00',NULL,'<p>Dia 26/04 → Card aberto na SIL<br>Dia 09/05 → Encaminhado layout da tabela de frete e cobrado posicionamento, sem respostas<br>Dia 13/06 → Cobrado posicionamento novamente</p>','2023-06-13 09:27:00','Tabelas de Frete'),(31,9410,0,1,'Cristiano Jacobsen','SINTRA','<p><strong>Cenario atual:</strong><br><br>-&gt; Clientes insatisfeitos e status da entrega incorreto<br>- CT-e e manifestado para entrega em parceiro para redespacho;<br>- VIPEX baixa a entrega;<br>- Cliente acessa o portal e o status consta como ENTREGUE;<br>- Carga ainda esta no parceiro;<br>- Cliente reclama no SAC, google e reclame aqui.<br><br>-<br><strong>Cenario ideal:</strong><br><br>- Desenvolver uma parametrizacao na regiao ou na praca (o que acharem ideal) para definir que esta praca quem realiza a entrega sao agentes. (Percebemos que nos parametros de praca, tem um campo para vincular um agente, no entanto, casos como Minas Gerais, as pracas de MG-AGT que serao entregas por um parceiro, normalmente sao 2 ou 3 parceiros). No caso, queriamos apenas um parametro que ativaria a praca/regiao para que ela correspondesse a agentes. Eu acredito que o melhor seria na regiao.<br><br>Requisito: Quando a regiao de destino do CTe corresponder a uma regiao de parceiros.<br>Efeito: Sistema nao permitira emitir manifesto de entrega, emitindo um alerta/pop-up escrito \"CTe com regiao de destino para agentes deve-se emitir manifesto de viagem\".<br>O sistema ira apenas permitir este CTe ser atrelado ao manifesto quando o mesmo for do tipo \'Viagem\'<br><br><strong>Situacao:</strong> Regiao de destino, pertence a agente mas a VIPEX realizará a entrega.<br>Efeito: De acordo com a diretoria, eles gostariam que usuarios especificos tivessem uma opcao onde eles poderiam liberar/bloquear quando a VIPEX fosse realizar a entrega.<br>Pois assim, existem casos onde devido ao grande volume de mercadorias, a VIPEX mesmo decidi fazer a entrega, entao, se existe a trava que nao permite atrelar o CTe de regiao de agente a um manifesto de entrega, como liberar?<br>A forma que pensei seria o mesmo que temos hoje para \"reentregas\", existe um usuario que lanca um historico no CTe e permite fazer a reentregar com o mesmo CTe.</p>','Em consultoria','Melhoria','2023-06-13 09:28:00',NULL,'<p>31/05 → Conversado via telefone com Cristiano para detalhar melhor o chamado</p>','2023-06-13 09:29:00','Regioes/Pracas para Entregas em Agentes (Parceiros)'),(32,10544,0,1,'Karina Fujisawa','SINTRA','<p>Na tela HFTR915 (Conhecimentos por Data) quando o usuario vai gerar um arquivo em CSV, com todas as colunas flagadas, ele tras corretamente o arquivo.<br>Quando e removido algumas colunas e e gerado o arquivo novamente, ele esta apagando o titulo das colunas, mantendo a coluna com os valores e trazendo os titulos das colunas que viriam depois dela para a esquerda<br><br>Segue planilhas em anexo de exemplo</p><p><strong>Exemplo</strong><br><br>Peso Cubado | Peso Nota | Peso cubado | MT3 | Valor das Notas<br>13234 | 12345 | 456 | 789 | 101112<br><br>Se remover as colunas de peso, ele fica desta forma:<br><br>MT3 | Valor das Notas |<br>13234 | 12345 | 456 | 789 | 101112</p>','Em desenvolvimento','Alta','2023-06-13 17:44:00',NULL,'<p>13/06 - Karina estará dando andamento na solicitação para correção</p>','2023-06-13 17:44:00','Relatórios de CTe\'s por Data com problema'),(33,10506,0,1,'Karina Fujisawa','SINTRA-Mobile','<p>Conforme conversa entre Karina e Francisco, os motoristas andam enfrentando alguns problemas em utilizar o app no offline, o app simplesmente fecha, ou pede para se logar novamente.<br>Seria interessante ja que nao conseguimos evitar esta situacao a possibilidade de anexar fotos de mercadorias direto da galeria do celular.<br><br>As vezes acontece que durante a entrega nao tem como ter acesso a internet e como o app nao vai funcionar offline, eles podem tirar as fotos e depois no caminhao no caminho de volta, ele pode anexar as imagens.</p>','Em análise','Alta','2023-06-13 17:47:00',NULL,NULL,'2023-06-13 17:48:00','Anexar fotos da galeria pelo SintraMobile'),(34,10600,0,1,'','SINTRA','<p>Apesar de já orientado, temos muitos CTe\'s para entrega em Redespacho que consequentemente a equipe acaba efetuando as baixas. O cliente recebe a informação que a mercadoria foi entregue, quando na verdade só foi deixada com o Redespachante e acaba gerando uma grande confusão.</p><p><br>Visando ajustar para que não ocorra essa baixa de entrega indevida. Pensamos em:</p><p>&nbsp; ..::: Inclusão de parâmetro na região :::..<br>Cadastramentos &gt; Do Sistema &gt; Regiões &gt; Pega uma região &gt; Ações &gt; Alterar (tela TCAD021)<br>Nesta tela, incluir um parâmetro chamado: \"Bloqueia baixa de entrega?\" - \"Sim\" ou \"Não\".</p><p>Caso \"Sim\", ele ocultará os CTe\'s que estão nesta \'região\' no app do SintraMobile e quando um usuário tentar efetivar uma baixa em um CTe deste tipo, ele aparecerá um aviso: \"Baixa de entrega nesta região está bloqueada este usuário\".</p><p>Ao mesmo tempo, terá um parâmetro dentro das configurações de usuário que pode ficar dentro de \"Permissões para conhecimentos\" na aba \"Conhecimentos\" (tela TSIL004b). Um parâmetro como: \"Baixa de entrega em região bloqueada?\" - \"Sim\" ou \"Não\". Por padrão, ao cadastrar um usuário, ele deve vir com este parâmetro como \"Não\".</p><p>Os usuários que tiverem este parâmetro como \"Sim\" tem permissão para baixar as entregas dos CTe\'s com a região de destino que o parâmetro \"Bloquear baixa de entrega\" foi imposto como \"Sim\".&nbsp;<br>&nbsp;</p>','Em consultoria','Critica','2023-06-15 13:40:00',NULL,NULL,NULL,'Bloqueio de Baixa de Entrega em Região de Redespacho'),(35,10299,0,1,'','SINTRA','<p>Hoje, nos deparamos com uma situacao em que foi emitido um CTe (25-19269) em 18/05/2023, para transportar a nota fiscal 6910, que foi emitida em 02/09/2022 (09 meses atras).<br>Na TCAD112 (Parametros de Conhecimentos) tem a opcao \"Limite emissao NF\", se observarmos, o estabelecimento 25 estava configurado para \"Seis meses\" no Limite de emissao e mesmo assim ele deixou efetivar o CTe.<br><br>Na tela TCAD112, a opcao \"Limite emissao NF\" funcione conforme os parametros passados na opcao</p>','Em análise','Alta','2023-06-16 08:40:00',NULL,NULL,NULL,'Limite emissao NF não esta funcionando'),(36,10622,0,1,'','Conferencia-Eletronica','<p>Aplicativo do <strong>Conferencia Eletronica</strong> ultimamente esta precisando sempre ficar limpando cache do dispositivo.<br>O processo o pessoal esta acessando as configuracoes de app, Limpa o armazenamento, limpa os dados e entrar no app novamente<br><br>Precisamos verificar por que esta sempre precisando limpar o app para os manifestos aparecerem</p>','Em consultoria','Critica','2023-06-16 10:01:00',NULL,NULL,NULL,'Problema de Cache no Conferencia Eletronica'),(37,10631,0,1,'','SINTRA','<p>Prezados,<br><br>Para contextualizar. Nos temos um cliente que trocou o sistema recentemente e neste sistema, ele nao consegue interpretar a Taxa de Dificuldade na Entrega (TRT/TDA).<br>Para isto, a equipe comercial analisou e achou interessante pegar a taxa do TRT/TDA e somar ao Despacho.<br>&nbsp;</p><p>Encontramos no sistema uma opcao em Cadastramentos &gt; De frete &gt; Regras de Frete &gt; Taxas e Formulas.<br><br>Em Taxas, nos criamos uma chamada DESPACHO00 que a identificacao da taxa no sistema e o Despacho<br>Depois, criamos uma chamada DESPACHO2 que a identificacao da taxa no sistema e a Dificuldade de entrega<br>Em seguida, utilizamos a opcao Formulas e criamos a formula TRT NATUZZI que somava a DESPACHO00 e a DESPACHO2.<br>Depois criamos uma taxa chamada TRTNATUZZI que faziamos a inclusao desta nova formula.<br><br>Mas nao conseguimos encontrar onde fazemos a inclusao disso para o cliente. Consegue nos ajudar? E tambem nos indicar se nossa percepcao da opcao era para esta serventia mesmo?</p>','Aguardando SIL','Alta','2023-06-16 10:02:00',NULL,NULL,NULL,'Regras de Frete'),(38,10637,0,1,'','SINTRA','<p>Na tela de Orcamentos (TFTR009a) temos a opcao de \"Reembolso\" que sempre vem demarcada como \"Nao\", nunca chegamos a utilizar, sempre deixamos como \"Nao\"<br>Qual a finalidade desta opcao, poderia nos explicar?</p>','Finalizado','Duvida','2023-06-16 11:48:00',NULL,NULL,NULL,'Reembolso no Orcamento'),(39,10849,0,1,'','SINTRA','<p>Link para o site do rastreador disponível no site da VIPEX retorna para uma tela ‘Close window’ de título.&nbsp;</p>','Finalizado','Critica','2023-06-21 08:25:00',NULL,NULL,NULL,'Rastreador do site VIPEX'),(40,10856,0,1,'','SINTRA','<p>Após a atualização para versão 04.42.789</p><p>Processo de uso de CPU em 100% e utilizando muita memória. Processo da sil-sistemas.&nbsp;</p><p>Sendo monitorado por Karina e Glaydson</p>','Aguardando SIL','Critica','2023-06-21 09:10:00',NULL,NULL,NULL,'Processamento alto do servidor');
