INSERT INTO `errors` VALUES (1,'RODOCRED','Erro integração Rodocred: Erro ao declarar CIOT na ANTT','<p>Quando estiver emitindo uma Ordem de Frete, &eacute; poss&iacute;vel que apare&ccedil;a uma janela de erro com os seguintes dizeres:<br />\r\n<br />\r\n<strong>Erros integra&ccedil;&atilde;o Rodocred: Erro ao declarar CIOT na ANTT: [Rejei&ccedil;&atilde;o: O ve&iacute;culo XXX1111 esta contratado para outro contratante&quot;. &quot;Rejeicao: Os veiculos de placas XXX1111 do transportador de RNTRC 00000000 est&atilde;o vinculados a uma opera&ccedil;&atilde;o de transporte do tipo TAC-Agregado com outro contratante.&quot;]</strong></p>\r\n\r\n<p>Este erro acontece quando o ve&iacute;culo mencionado no documento foi contratada por outra empresa, um motorista n&atilde;o pode ser contratado por duas empresas ao mesmo tempo. Caso, ele mencione que os servi&ccedil;os com a empresa anterior foram encerrados, pe&ccedil;a ao mesmo para entrar em contato com a empresa contratante e solicitar a finaliza&ccedil;&atilde;o da viagem do motorista. Enquanto este procedimento n&atilde;o &eacute; feito, n&atilde;o &eacute; poss&iacute;vel emitir ordem de frete.&nbsp;</p>\r\n'),(2,'ALERTA','Tipo de Frete Pago/A Pagar Inválido para Parâmetro paga Frete','<p>Normalmente este erro ocorre quando o pagador&nbsp;<strong>n&atilde;o paga o frete</strong>. Isto deve-se a equipe Administrativa do Comercial ter realizado o bloqueio para n&atilde;o efetuar o pagamento do frete. Isto deve-se a v&aacute;rias circust&acirc;ncias, para verificar se procede esta informa&ccedil;&atilde;o. Clique sobre o CNPJ do pagador para abrir as informa&ccedil;&otilde;es e v&aacute; at&eacute; a aba &quot;<strong>Ocorr&ecirc;ncias&quot;</strong>, l&aacute; busque por qualquer item que esteja mencionado na coluna&nbsp;<strong>Descri&ccedil;&atilde;o&nbsp;</strong>como&nbsp;<strong>Altera&ccedil;&atilde;o Par&acirc;metros 1</strong>. Clique sobre a data para visualizar, normalmente haver&aacute; algum texto como: &quot;<strong>Paga Frete: De S p/ N&quot;</strong><br />\r\n<br />\r\nPara resolver, ligue na equipe administrativa do Comercial para tirar d&uacute;vidas quanto a situa&ccedil;&atilde;o.</p>\r\n'),(3,'ALERTA','Orçamento c/ informações divergentes tipo Frete/Origem/Destino','<p>Este aviso aparece quando existe uma diverg&ecirc;ncia de informa&ccedil;&otilde;es entre o CT-e que est&aacute; sendo digitado e o Or&ccedil;amento criado. Normalmente, algo est&aacute; preenchido errado.&nbsp;<br />\r\nComo o pr&oacute;prio alerta diz, deve-se confrontar os endere&ccedil;os de remetente e destinat&aacute;rio do CTe com o do Or&ccedil;amento para ver se est&atilde;o iguais, caso sim, verificar os preenchimentos relacionados ao frete.&nbsp;<br />\r\n<br />\r\nEm 90% dos casos, o problema est&aacute; nos endere&ccedil;os.&nbsp;<br />\r\n<br />\r\nCaso o problema continue persistindo mesmo com as informa&ccedil;&otilde;es validadas, voc&ecirc; pode neste primeira tela do CT-e, remover o n&uacute;mero de Or&ccedil;amento e clicar em Confirmar. Ao passar para a segunda tela do Conhecimento, ele vai buscar o Or&ccedil;amento automaticamente, voc&ecirc; o seleciona e ele inclui normalmente.&nbsp;<br />\r\n<br />\r\nSe nenhuma das solu&ccedil;&otilde;es acima funcionar, acione a equipe de T.I para aux&iacute;lio.&nbsp;</p>\r\n'),(4,'#103','Lote recebido com sucesso','<p>Quando este status de rejei&ccedil;&atilde;o aparece, normalmente &eacute; quando o emissor est&aacute; emitindo CT-e&#39;s em Lote, se voc&ecirc; estiver emitindo CTe&#39;s em lote e 1 deles estiver com problema e os outros estiverem tudo certo, os corretos ter&atilde;o atribu&iacute;do o status 103 - Lote Recebido com Sucesso. Para solucionar esta rejei&ccedil;&atilde;o, deve-se pegar o n&uacute;mero do CTe e no SintraWeb acessar:<br />\r\n<br />\r\n<strong>Conhecimentos -&gt; CT-e &gt; Consulta situa&ccedil;&atilde;o CT-e</strong><br />\r\n<br />\r\nSe o CT-e estiver correto, ele atribuir&aacute; automaticamente o status&nbsp;<strong>100 - Autorizado o Uso do CT-e</strong>, nisto, o sistema enviou as informa&ccedil;&otilde;es do CTe para o SEFAZ e a DACTE j&aacute; foi retornada para o sistema. Basta acessar o CTe e imprimir a DACTE.&nbsp;<br />\r\nCaso ele retorne outro status de erro, consulte nesta p&aacute;gina se encontra a solu&ccedil;&atilde;o. Se n&atilde;o encontrar, acione o T.I</p>\r\n'),(5,'#631',' Rejeição: Duplicidade de evento [nProt:999999999999999]','<p>Quando for emitido evento para uma NFe, CTe ou MDFe que j&aacute; possui um Evento de mesmo tipo e com mesmo n&uacute;mero sequencial, ser&aacute; retornado a rejei&ccedil;&atilde;o <strong>&quot;631 - Duplicidade de Evento&quot;</strong></p>\r\n\r\n<p><strong>EXEMPLO:&nbsp;</strong><br />\r\nFoi feito a tentativa de cancelar um CTe que j&aacute; estava cancelado ou encerrar um MDFe que j&aacute; est&aacute; encerrado. Logo, como estamos tentando lan&ccedil;ar este evento novamente, o SEFAZ aponta a duplicidade do evento e n&atilde;o permite lan&ccedil;ar.&nbsp;<br />\r\n<br />\r\nDito isto, caso sua solicita&ccedil;&atilde;o seja para CTe ou para MDFe, consulte-o novamente e veja se o evento que voc&ecirc; est&aacute; tentando lan&ccedil;ar, n&atilde;o j&aacute; est&aacute; presente no documento.<br />\r\n<br />\r\n<strong>CONSULTEI O DOCUMENTO E ELE N&Atilde;O POSSUI O EVENTO EM QUEST&Atilde;O, O QUE EU FA&Ccedil;O?</strong><br />\r\nNeste caso, voc&ecirc; deve consultar a situa&ccedil;&atilde;o do CTe ou do MDF-e para que o SEFAZ retorne o status lan&ccedil;ado.&nbsp;</p>\r\n'),(6,'#108','Serviço Paralisado Momentâneamente (curto prazo)','<p>Este erro ocorre quando o SEFAZ est&aacute; com seus servi&ccedil;os paralisados, o c&oacute;digo #108 categoriza uma paralisa&ccedil;&atilde;o de curto prazo.&nbsp;</p>\r\n\r\n<p>Justamente pelo servi&ccedil;o paralisado, n&atilde;o se torna poss&iacute;vel realizar a emiss&atilde;o de CTe&#39;s mesmo no&nbsp;<strong>Modo Emiss&atilde;o em Conting&ecirc;ncia</strong>, neste caso, n&atilde;o h&aacute; nada a se fazer. O que deve ser feito &eacute; realizar uma nova tentativa de emiss&atilde;o a cada 20 min para verificar se o sistema do SEFAZ voltou.&nbsp;</p>\r\n'),(7,'#109','Serviço Paralisado sem Previsão','<p>O status #109 &eacute; um indicador que o servidor do SEFAZ est&aacute; paralisado e n&atilde;o possui previs&atilde;o de retorno. Nesta situa&ccedil;&atilde;o em espec&iacute;fico, voc&ecirc; deve entrar em contato com a Matriz, para ativar o&nbsp;<strong>Modo Emiss&atilde;o em Conting&ecirc;ncia</strong></p>\r\n'),(8,'#113','Serviço SVC em Operação. Desativação prevista para a UF em *DATA*, às *HORAS*','<p>O status #113 &eacute; apenas um indicativo que o&nbsp;<strong>Modo Emiss&atilde;o em Conting&ecirc;ncia</strong>&nbsp;est&aacute; em opera&ccedil;&atilde;o e a data e hor&aacute;rio indicado no status &eacute; referente h&aacute; quando este Modo ir&aacute; se encerrar.</p>\r\n'),(9,'#114','SVC desabilitada pela SEFAZ na origem	','<p>O status #114 ocorre quando estamos utilizando o&nbsp;<strong>Modo Emiss&atilde;o em Conting&ecirc;ncia</strong>&nbsp;e os servi&ccedil;os do SEFAZ j&aacute; voltaram a funcionar.<br />\r\nEnt&atilde;o, voc&ecirc; deve entrar em contato com a MATRIZ para desativar o&nbsp;<strong>Modo Emiss&atilde;o em Conting&ecirc;ncia</strong>.</p>\r\n'),(10,'#204','Rejeição: Duplicidade de CTe','<p>&Eacute; apresentado este erro quando tentamos validar um CTe j&aacute; validado ou autorizado pelo SEFAZ.<br />\r\nPara solucionar este erro voc&ecirc; deve: Acessar:&nbsp;<strong>Conhecimentos</strong>&nbsp;&nbsp;&nbsp;&nbsp;<strong>CT-e</strong>&nbsp;&nbsp;&nbsp;&nbsp;<strong>Consulta situa&ccedil;&atilde;o CT-e</strong><br />\r\n<br />\r\nAp&oacute;s acessar a tela, preencha os campos correspondentes:<br />\r\n<strong>Estabelecimento</strong>&nbsp;|&nbsp;<strong>N&uacute;mero</strong>&nbsp;e pressione&nbsp;<strong>CONFIRMAR</strong><br />\r\n<br />\r\nCom isto, um aviso no canto superior direito ir&aacute; aparecer na tela:</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&quot;Consulta do Conhecimento: 000XXXXXX<br />\r\n100 - Autorizado o uso do CT-e&quot;</strong></p>\r\n\r\n<p>Com isto, o problema est&aacute; solucionado.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),(11,'#209','IE do emitente inválida','<p>O c&oacute;digo de <strong>status #209</strong> &eacute; refere-se a <strong>Inscri&ccedil;&atilde;o Estadual do emitente que est&aacute; incorreta</strong>.&nbsp;<br />\r\n<br />\r\nIsto ocorre devido a algumas situa&ccedil;&otilde;es:<br />\r\n&bull; No cadastro do remetente, n&atilde;o est&aacute; cadastrado a inscri&ccedil;&atilde;o estadual dele. Para descobrir qual &eacute; a inscri&ccedil;&atilde;o estadual, voc&ecirc; precisa do CNPJ do remetente e saber qual a UF de origem deste CNPJ. Ap&oacute;s conseguir estas informa&ccedil;&otilde;es, acesse o site do&nbsp;<a href=\"http://www.sintegra.gov.br/\">SINTEGRA</a>&nbsp;escolha a UF desejada e fa&ccedil;a uma busca utilizando o n&uacute;mero do CNPJ.&nbsp;<br />\r\n<br />\r\n&bull; A mais frequente das situa&ccedil;&otilde;es &eacute; que o remetente &eacute; de um estado mas o endere&ccedil;o selecionado na digita&ccedil;&atilde;o do CTe corresponde a outro estado. Exemplo: Um cliente possui um <strong>CNPJ de SP </strong>e consequentemente sua <strong>IE tamb&eacute;m &eacute; de SP.</strong> Se voc&ecirc; mencion&aacute;-lo no CT-e e <strong>selecionar que o endere&ccedil;o dele &eacute; no estado do RJ</strong>, ele vai acusar este erro. Eu n&atilde;o posso mencionar um cliente com seu CNPJ de SP e escolher o endere&ccedil;o de outro. O ideal &eacute; que caso trate-se de outro estado, voc&ecirc; precisa do CNPJ do estado correspodente.&nbsp;<br />\r\n&nbsp;</p>\r\n'),(12,'#210','IE do Destinatário Inválida','<p>O c&oacute;digo de <strong>status #210</strong> &eacute; refere-se a <strong>Inscri&ccedil;&atilde;o Estadual do destinat&aacute;rio que est&aacute; incorreta</strong>.&nbsp;<br />\r\n<br />\r\nIsto ocorre devido a algumas situa&ccedil;&otilde;es:<br />\r\n&bull; No cadastro do destinat&aacute;rio, n&atilde;o est&aacute; cadastrado a inscri&ccedil;&atilde;o estadual dele. Para descobrir qual &eacute; a inscri&ccedil;&atilde;o estadual, voc&ecirc; precisa do CNPJ e tamb&eacute;m saber qual a UF de origem deste CNPJ. Ap&oacute;s conseguir estas informa&ccedil;&otilde;es, acesse o site do&nbsp;<a href=\"http://www.sintegra.gov.br/\">SINTEGRA</a>&nbsp;escolha a UF desejada e fa&ccedil;a uma busca utilizando o n&uacute;mero do CNPJ.&nbsp;<br />\r\n<br />\r\n&bull; A mais frequente das situa&ccedil;&otilde;es &eacute; que o destinat&aacute;rio &eacute; de um estado mas o endere&ccedil;o selecionado na digita&ccedil;&atilde;o do CTe corresponde a outro estado. Exemplo: Um cliente possui um <strong>CNPJ de SP </strong>e consequentemente sua <strong>IE tamb&eacute;m &eacute; de SP.</strong> Se voc&ecirc; mencion&aacute;-lo no CT-e e <strong>selecionar que o endere&ccedil;o dele &eacute; no estado do RJ</strong>, ele vai acusar este erro. Eu n&atilde;o posso mencionar um cliente com seu CNPJ de SP e escolher o endere&ccedil;o de outro. O ideal &eacute; que caso trate-se de outro estado, voc&ecirc; precisa do CNPJ do estado correspodente. Conserte o endere&ccedil;o na digita&ccedil;&atilde;o do CT-e<br />\r\n&nbsp;</p>\r\n'),(13,'#211','IE do Substituto Inválida','<p>O c&oacute;digo de <strong>status #211</strong>&nbsp;&eacute; refere-se a <strong>Inscri&ccedil;&atilde;o Estadual do substituto que est&aacute; incorreta</strong>.&nbsp;<br />\r\n<br />\r\nIsto ocorre devido a algumas situa&ccedil;&otilde;es:<br />\r\n&bull; No cadastro do substituto, n&atilde;o est&aacute; cadastrado a inscri&ccedil;&atilde;o estadual dele. Para descobrir qual &eacute; a inscri&ccedil;&atilde;o estadual, voc&ecirc; precisa do CNPJ e tamb&eacute;m saber qual a UF de origem deste CNPJ. Ap&oacute;s conseguir estas informa&ccedil;&otilde;es, acesse o site do&nbsp;<a href=\"http://www.sintegra.gov.br/\">SINTEGRA</a>&nbsp;escolha a UF desejada e fa&ccedil;a uma busca utilizando o n&uacute;mero do CNPJ.&nbsp;<br />\r\n<br />\r\n&bull; A mais frequente das situa&ccedil;&otilde;es &eacute; que o substituto &eacute; de um estado mas o endere&ccedil;o selecionado na digita&ccedil;&atilde;o do CTe corresponde a outro estado. Exemplo: Um cliente possui um <strong>CNPJ de SP </strong>e consequentemente sua <strong>IE tamb&eacute;m &eacute; de SP.</strong> Se voc&ecirc; mencion&aacute;-lo no CT-e e <strong>selecionar que o endere&ccedil;o dele &eacute; no estado do RJ</strong>, ele vai acusar este erro. Eu n&atilde;o posso mencionar um cliente com seu CNPJ de SP e escolher o endere&ccedil;o de outro. O ideal &eacute; que caso trate-se de outro estado, voc&ecirc; precisa do CNPJ do estado correspodente. Conserte o endere&ccedil;o na digita&ccedil;&atilde;o do CT-e<br />\r\n&nbsp;</p>\r\n'),(14,'#212','Data de emissao CTe posterior a data de recebimento','<p>Este erro acontece quando o hor&aacute;rio da emiss&atilde;o de um CTe &eacute; depois da hora que foi marcado o recebimento.&nbsp;</p>\r\n\r\n<p>Por exemplo:<br />\r\nVoc&ecirc; realizou a emiss&atilde;o de um CTe, ele est&aacute; com data-hora da emiss&atilde;o dia 29/04/2021 &agrave;s 17:03. No entanto, a data-hora do recebimento est&aacute; como 29/04/2021 &agrave;s 16:45.<br />\r\n<br />\r\nO que deve ser feito neste caso, &eacute; realizar uma nova &quot;passagem&quot; pela tela de digita&ccedil;&atilde;o do CTe, reconfirm&aacute;-lo para verificar se a data &eacute; alterada, em alguns casos, ela &eacute; alterada e &eacute; poss&iacute;vel de fazer emiss&atilde;o do CTe. Em outros casos, voc&ecirc; deve aguardar at&eacute; o hor&aacute;rio de emiss&atilde;o do CTe (seguindo o exemplo: 17:03) para poder emit&iacute;-lo novamente.&nbsp;</p>\r\n'),(15,'#214','Rejeição: Tamanho da mensagem excedeu o limite estabelecido','<p>A Rejei&ccedil;&atilde;o <strong>#214</strong>, indica que ao emitir uma NF-e, o tamanho da mensagem excedeu o limite de <strong>500Kb </strong>estabelecido pela <strong>SEFAZ </strong>e nesse caso a <strong>rejei&ccedil;&atilde;o 214 ir&aacute; ocorrer.</strong><br />\r\n<br />\r\nNa pr&aacute;tica, o que isso significa? Que devemos ficar atentos ao tamanho da mensagem de uma NFe, o recomendado &eacute; que a aplica&ccedil;&atilde;o verifique o tamanho da mensagem logo ap&oacute;s gerar a NF-e para que n&atilde;o ultrapasse o limite de tamanho da SEFAZ.<br />\r\n<br />\r\n<strong>PS</strong>: Embora esteja aqui na lista de erro, &eacute; muito improv&aacute;vel que isto ocorra, devido que ao pr&oacute;prio <strong>SINTRA </strong>j&aacute; realiza a emiss&atilde;o de uma NFe dentro do tamanho estipulado para o <strong>SEFAZ</strong>, logo, este erro &eacute; classificado como improv&aacute;vel de ocorrer.</p>\r\n'),(16,'#215','Rejeição: Falha no schema XML	','<p>Ao emitir um CTe, &eacute; poss&iacute;vel que apare&ccedil;a a mensagem&nbsp;<strong>215 - Rejei&ccedil;&atilde;o: Falha no schema XML</strong><br />\r\nEste erro indica que o XML transmitido a SEFAZ n&atilde;o est&aacute; em conformidade. Ele ocorre devido a v&aacute;rios motivos, mas vamos explicar aqui uma forma f&aacute;cil de encontrar o erro, voc&ecirc; vai utilizar o Sintra e o Google Tradutor pois o erro retornado, ser&aacute; em ingl&ecirc;s.&nbsp;<br />\r\n<br />\r\nPrimeira coisa a fazer &eacute; consultar o CTe no sistema, voc&ecirc; pode consultar acessando as op&ccedil;&otilde;es:<br />\r\n<strong>Conhecimentos &gt; Consultas &gt; Conhecimentos por N&uacute;mero&nbsp;</strong>(caso saiba o n&uacute;mero do Cte)<br />\r\n<strong>Conhecimentos &gt; Consultas &gt; Conhecimentos por Data&nbsp;</strong>(caso tenha apenas a data de emiss&atilde;o do CTe)<br />\r\n<strong>Conhecimentos &gt; Consultas &gt; Notas Fiscais&nbsp;</strong>(caso voc&ecirc; tenha apenas a nota fiscal para encontrar o Cte)<br />\r\n<br />\r\nConsultando o CTe, voc&ecirc; ir&aacute; clicar em&nbsp;<strong>A&ccedil;&otilde;es &gt; Consulta XML.</strong><br />\r\nEle ir&aacute; te direcionar para uma tela visualizadora de XML do CT-e.<br />\r\nVoc&ecirc; ir&aacute; clicar primeiramente em&nbsp;<strong>Copiar XML</strong>&nbsp;e depois em&nbsp;<strong>Validar XML,&nbsp;</strong>ao clicar em Validar XML, ele ir&aacute; te direcionar para uma p&aacute;gina <strong>Validadora de Mensagens do Projeto CT-e.&nbsp;&nbsp;</strong>Cole toda XML dentro do espa&ccedil;o para digita&ccedil;&atilde;o e depois clique em&nbsp;<strong>Validar</strong>.&nbsp;<br />\r\n<br />\r\nLogo abaixo do bot&atilde;o, ele ir&aacute; retornar um texto, caso haja algum erro, ele ir&aacute; apresentar neste local onde est&aacute; o erro no documento, ele ir&aacute; mostrar qual a tag com erro e qual o valor digitado que est&aacute; errado.&nbsp;<br />\r\n<br />\r\nCaso n&atilde;o consiga entender direito a frase em ingl&ecirc;s que normalmente aparece, voc&ecirc; pode jog&aacute;-lo no Google Tradutor para melhor entender, mas vou falar aqui dos locais mais comuns de apresentar o erro.&nbsp;<br />\r\n<br />\r\nA tag <strong>&lt;fone&gt;</strong>, diz respeito ao telefone que pode ser ou do Remetente / Expedidor / Destinat&aacute;rio / Recebedor<br />\r\nas tags&nbsp;<strong>&lt;xLgr&gt; &lt;nro&gt; &lt;xCpl&gt; &lt;xBairro&gt; &lt;cMun&gt; &lt;xMun&gt; &lt;CEP&gt; &lt;UF&gt; &lt;cPais&gt; &lt;xPais&gt;&nbsp;</strong>normalmente dizem respeito ao endere&ccedil;o mencionado que pode ser do Remetente / Expedidor / Destinat&aacute;rio / Recebedor.&nbsp;<br />\r\nAs tags&nbsp;<strong>&lt;email&gt;&nbsp;</strong>normalmente s&atilde;o as vencedoras, 90% das vezes em que este erro aparece, o problema est&aacute; no e-mail do cadastro do Remetente / Expedidor / Destinat&aacute;rio ou Recebedor que est&aacute; com e-mail digitado errado (as vezes, falta o &#39;.com.br&#39;, as vezes tem s&oacute; @gmail, as vezes falta o &#39;@&#39;).<br />\r\n<br />\r\nAjustando isso no cadastro do cliente basta fazer a reemis&atilde;o do documento.&nbsp;<br />\r\n<br />\r\n<br />\r\n<br />\r\n&nbsp;</p>\r\n'),(17,'#216','Rejeição: Chave de Acesso difere da cadastrada','<p>Para resolver a <strong>Rejei&ccedil;&atilde;o 216</strong>, deve ser informada na consulta de <strong>CT-e </strong>exatamente a <strong>mesma chave de acesso enviada</strong>, ou seja, todos os campos que formam a chave de acesso devem ser exatamente os mesmos do CT-e enviado.<br />\r\n<br />\r\nNo caso de se obter a <strong>rejei&ccedil;&atilde;o 216</strong>, est&aacute; sendo informada uma chave de acesso onde o campo <strong>c&oacute;digo num&eacute;rico da chave est&aacute; diferente do cadastrado na base de dados da SEFAZ.</strong><br />\r\n<br />\r\nA Rejei&ccedil;&atilde;o (<strong>216</strong>):&quot;<strong>Chave de Acesso difere da cadastrada&quot;</strong>, indica que o &quot;<strong>C&oacute;digo Num&eacute;rico&quot;</strong> da chave de acesso que foi informada na consulta &eacute; diferente do da chave que j&aacute; est&aacute; cadastrada na base de dados da <strong>SEFAZ </strong>e nesse caso a rejei&ccedil;&atilde;o <strong>216 </strong>ir&aacute; ocorrer.<br />\r\n<br />\r\nPara resolver, apenas corrigindo o conte&uacute;do da <strong>Chave de acesso </strong>ao enviar uma <strong>NF-e (mod 55)</strong> para executar qualquer tipo de opera&ccedil;&atilde;o devemos informar a chave de acesso que consta na base de dados do &oacute;rg&atilde;o autorizador.</p>\r\n'),(18,'#217','Rejeição: CTe não consta na base de dados do SEFAZ','<p>O status de erro #217, indica que o CTe n&atilde;o est&aacute; presente no banco de dados da SEFAZ. Ou seja, por algum motivo, as informa&ccedil;&otilde;es do CTe n&atilde;o foram enviadas para a SEFAZ.&nbsp;<br />\r\n<br />\r\nIsto ocorre em duas situa&ccedil;&otilde;es:<br />\r\n1 - O colaborador digitou o CTe, realizou a emiss&atilde;o e n&atilde;o prestou aten&ccedil;&atilde;o no alerta de rejei&ccedil;&atilde;o retornado pelo sistema. Logo, quando ele consultar a situa&ccedil;&atilde;o do CTe, ir&aacute; retornar o status de rejei&ccedil;&atilde;o #217.&nbsp;<br />\r\n<br />\r\n2 - O colaborador est&aacute; emitindo um lote de CTe&#39;s (2 CTe&#39;s ou mais) e dentro deste lote alguns ou apenas um CTe deu problema, automaticamente, todos os CTes ficam com o status 103 (Lote recebido com sucesso) atribu&iacute;do e logo, &eacute; necess&aacute;rio consultar a situa&ccedil;&atilde;o de todos eles para dar o erro #217.<br />\r\n<br />\r\nNesta situa&ccedil;&atilde;o, &eacute; necess&aacute;rio que voc&ecirc; tente reemitir o CTe. Acessando pelo Sintra e indo em:&nbsp;<strong>Conhecimentos &gt; Emiss&atilde;o / Reemiss&atilde;o</strong>. Ap&oacute;s acessar a tela, preencha os campos correspondentes, selecione o CTe e clique em&nbsp;<strong>COnfirmar.&nbsp;</strong><br />\r\n<br />\r\nIsto, far&aacute; o CTe gerar o c&oacute;digo de rejei&ccedil;&atilde;o que aponta o erro real.&nbsp;</p>\r\n'),(19,'#218','Rejeição: CTe já está cancelado na base de dados da SEFAZ	','<p>Este erro ocorre quando por algum motivo, o contribuinte j&aacute; fez um cancelamento do conhecimento e a aplica&ccedil;&atilde;o do emissor do contribuinte n&atilde;o atualizou a situa&ccedil;&atilde;o deste para&nbsp;<strong>&ldquo;Cancelado&rdquo;.</strong><br />\r\n<br />\r\n<strong>Solu&ccedil;&atilde;o:</strong><br />\r\n<br />\r\nPara resolver o problema, clicar no bot&atilde;o fechar e depois no bot&atilde;o &ldquo;<strong>Consultar situa&ccedil;&atilde;o na SEFAZ&rdquo;</strong> da tela de gerenciar Conhecimento e o conhecimento deve ir para a situa&ccedil;&atilde;o autorizada.</p>\r\n'),(20,'#652','Rejeição: NF-e não pode estar cancelada ou denegada	','<p>Quando a&nbsp;<strong>NF-e (Nota Fiscal Eletr&ocirc;nica)</strong>&nbsp;inserida no CTe foi&nbsp;<strong>Cancelada</strong>&nbsp;pelo emissor.<br />\r\n<br />\r\nExemplo hipot&eacute;tico:<br />\r\nFoi emitida a NF-e, contudo ela foi cancelada. Ao tentar emitir o CT-e com essa nota a SEFAZ ir&aacute; apresentar a mensagem&nbsp;<strong><em>Rejei&ccedil;&atilde;o: NF-e n&atilde;o pode estar cancelada ou denegada.</em></strong><br />\r\n<br />\r\nNeste caso, o que se deve-se fazer &eacute; entrar em contato com o emissor da NFe solicitando uma nova nota e depois alterar os dados CT-e.<br />\r\nFeita a corre&ccedil;&atilde;o, basta reenviar o CT-e.</p>\r\n'),(21,'#746','Rejeição: Tipo de Serviço Inválido para o Tomador','<p>Primeiro passo, &eacute; consultar o CNPJ do tomador do frete na&nbsp;<a href=\"https://servicos.receita.fazenda.gov.br/servicos/cnpjreva/cnpjreva_solicitacao.asp\">Receita Federal</a>&nbsp;e averiguar se o mesmo dentro de suas atividades principais ou secund&aacute;rias possui &quot;transporte de mercadoria&quot; ou sua atividade d&aacute;-se a entender que tamb&eacute;m &eacute; feito o transporte. Ao fazer a busca pelo CNPJ, ele vai te retornar um documento emitido pela Rep&uacute;blica Federativa do Brasil, voc&ecirc; vai procurar pelos itens &quot;C&oacute;digo e Descri&ccedil;&atilde;o da Atividade Econ&ocirc;mica Principal&quot; e a &quot;Secund&aacute;ria&quot;<br />\r\nEm alguns casos, est&aacute; expl&iacute;cito: &quot;Transporte rodovi&aacute;rio de mercadorias/cargas [...]&quot; em outros pode estar como &quot;Com&eacute;rcio varejista de m&oacute;veis&quot; ou &quot;Servi&ccedil;os de montagem de m&oacute;veis&quot;, logo da-se a entender, que uma empresa que faz a montagem dos m&oacute;veis, tamb&eacute;m os transporta correto? Talvez n&atilde;o necessariamente, mas para o SEFAZ isso significa que SIM.<br />\r\n<br />\r\nCaso o CNPJ n&atilde;o tenha nada a ver com transporte de mercadorias e est&aacute; dando este erro, voc&ecirc; pode acionar o T.I via chamado informando o c&oacute;digo de erro e o n&uacute;mero do CTe para avalia&ccedil;&atilde;o.<br />\r\nCaso o seu caso bata com as descri&ccedil;&otilde;es acima, duas solu&ccedil;&otilde;es s&atilde;o poss&iacute;veis:<br />\r\n<br />\r\n<strong>1&deg; SOLU&Ccedil;&Atilde;O:&nbsp;</strong>O CNPJ que foi apontado como poss&iacute;vel &quot;transportadora&quot; deve possuir um CTe da mercadoria transportada e durante a emiss&atilde;o, l&aacute; embaixo na sess&atilde;o de log&iacute;stica voc&ecirc; vai inserir as informa&ccedil;&otilde;es do CTe e depois trocar o Tipo de Distribui&ccedil;&atilde;o para Redespacho.<br />\r\n<strong>2&deg; SOLU&Ccedil;&Atilde;O:&nbsp;</strong>No segundo caso, o cliente n&atilde;o possui CTe e nem ir&aacute; emitir. Logo, o que deve ser feito: Voc&ecirc; vai alterar o tomador do CTe para o Remetente ou Destinat&aacute;rio e emitir desta forma.<br />\r\nDepois ligar&aacute; na Cobran&ccedil;a solicitando a Revers&atilde;o do Frete para o CNPJ correto. &Eacute; importante mencionar para o cliente que no CTe, ele n&atilde;o vir&aacute; mencionado como tomador, mas na fatura, vir&aacute; normalmente.<br />\r\n<br />\r\n&quot;Ah, mas o cliente n&atilde;o quer assim&quot;, infelizmente, n&atilde;o parte de n&oacute;s, &eacute; uma requisi&ccedil;&atilde;o que parte direto da SEFAZ para que seja feito desta forma. Se n&atilde;o aceita nenhuma das solu&ccedil;&otilde;es, n&atilde;o &eacute; poss&iacute;vel realizar a emiss&atilde;o.</p>\r\n'),(22,'#132','Encerramento de MDF-e homologado','<p>Se o evento de encerramento for homologado (conclu&iacute;do), a situa&ccedil;&atilde;o do MDF-e para efeito de consulta situa&ccedil;&atilde;o passar&aacute; para 132 - Encerramento homologado</p>\r\n');
